}

function App() {
  return (
    <div className="app">
      <main>
        <div className="search-box">
          <input type="text" 
          className="search-bar"
          placeholder="search"/>
        </div>
        <div className="location-box">
          <div className="location"></div>
          <div className="dte"></div>
        </div>
        <div className="weather-box">
          <div className="temp">15c</div>
          <div className="weather">sunny</div>
        </div>
      </main>
    </div>
  );
}

export default App;
